INSERT INTO `artigos` (`id`, `titulo`, `url`, `text`, `headers`, `slug`) VALUES
(5, 'Sustentabilidade ambiental, social e empresarial. Conheça a importância de cada uma delas!', '3592_500_380.png', '&lt;p&gt;A palavra sustentabilidade vem do latim sustentare e tem como significado: apoiar, cuidar, sustentar e cuidar. Sendo assim, sustentabilidade nada mais é do que a capacidade que se tem para conservar ou sustentar um sistema ou processo.&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;O conceito da palavra sustentabilidade tem relação direta com a natureza, mas não apenas a ela, pois a aplicabilidade dele cabe tanto com a comunidade como ao planeta.&amp;nbsp;&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;Quando falamos em desenvolvimento sustentável, o objetivo não está restrito a preservação do planeta, mas também tem como foco as necessidades que os seres humanos apresentam, mas fazendo uso dos recursos naturais de forma sustentável para que ele não acabe de uma hora para outra e sempre pensando que as próximas gerações também precisarão dele para viver.&amp;nbsp;&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;Sustentabilidade é montada em um tripé&amp;nbsp;&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;O tripé da sustentabilidade é composto por três princípios que são: ambiental, social e econômico. Sem um deles, não tem como a sustentabilidade acontecer!&amp;nbsp;&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;Quando falamos em ambiental, fazemos referência aos recursos naturais que o planeta tem, mas não só isso, pois precisamos abordar a forma como as comunidades, a sociedade e as empresas fazem uso deles.&amp;nbsp;&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;A parte social diz respeito as condições de vida que são apresentadas pelas pessoas e isso inclui o acesso a educação, saúde, lazer e outros itens e o econômico aborda a forma como os bens e serviços são produzidos, distribuídos e consumidos e a econômica precisa avaliar a questão ambiental e social.&amp;nbsp;&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;Diferenças entre a sustentabilidade ambiental, social e empresarial&amp;nbsp;&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;Dentro da sustentabilidade ambiental está a forma como o meio ambiente é mantido e conservado. Para que a sustentabilidade ambiental traga efeitos, faz-se necessário que os seres humanos trabalhem em harmonia com o meio ambiente, pois por meio do ambiente há melhorias na qualidade da vida.&amp;nbsp;&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;Sendo assim, o foco dentro da sustentabilidade ambiental é a manutenção dos recursos para as próximas gerações, por isso a geração atual não pode comprometer o meio ambiente.&amp;nbsp;&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;Quando falamos em sustentabilidade social queremos tratar sobre a igualdade entre as pessoas de forma que todas vivam bem. No aspecto da sustentabilidade social faz-se necessário que a população participe sempre buscando o fortalecimento das propostas que visem trazer maior acesso a cultura, saúde e educação de todas as pessoas.&amp;nbsp;&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;Por fim, quando falamos em sustentabilidade empresarial queremos afirmar que muitas empresas têm definido suas estratégias, tendo como foco a responsabilidade social que elas têm com o meio onde elas estão inseridas.&amp;nbsp;&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;Muitos acham que não, porém as pessoas estão muito mais atentas a forma como as instituições que visam lucro estão trabalhando. Quanto mais elas apostarem em produtos e ações que preservem o meio ambiente maior apreço os consumidores terão por ela.&amp;nbsp;&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;Diante desse cenário, é de extrema importância que as empresas que querem participar e apoiar ativamente deve apostar em ações voltadas ao meio ambiente, com envolvimento de toda a direção e colaboradores.&amp;nbsp;&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;Em tempos como os atuais, uma empresa que quer se destacar precisa desenvolver ações pensadas ao meio ambiente de forma efetiva e não apenas em se promover.&amp;nbsp;&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;Por este motivo, o Grupo Precisão está se empenhando cada vez mais em apoiar projetos em busca de melhorias com a natureza; onde juntos podemos fazer a diferença.&lt;/p&gt;', '&lt;title&gt;Sustentabilidade ambiental, social e empresarial. Conheça a importância de cada uma delas!&lt;/title&gt; \r\n \r\n&lt;meta name=&quot;description&quot; content=&quot;Quando falamos em sustentabilidade social queremos tratar sobre a igualdade entre as pessoas de forma que todas vivam bem.&quot; /&gt; \r\n \r\n&lt;meta name=&quot;keywords&quot; content=“sustentabilidade ambiental, meio ambiente, cuidado com o meio ambiente&quot; /&gt; \r\n\r\n&lt;meta name=&quot;rating&quot; content=&quot;General&quot; /&gt; \r\n\r\n&lt;meta name=&quot;expires&quot; content=&quot;0&quot; /&gt;\r\n\r\n&lt;meta name=&quot;language&quot; content=&quot;portuguese, PT-BR&quot; /&gt; \r\n\r\n&lt;meta name=&quot;distribution&quot; content=&quot;Global&quot; /&gt; \r\n\r\n&lt;meta name=&quot;author&quot; content=&quot;SD - http://www.system-dreams.com&quot; /&gt;\r\n\r\n&lt;meta name=&quot;publisher&quot; content=&quot;SD - http://www.system-dreams.com&quot; /&gt; \r\n\r\n&lt;meta name=&quot;copyright&quot; content=&quot;SystemDreams - Criação e Otimização de sites&quot; /&gt;', 'sustentabilidade-ambiental-social-e-empresarial-conheca-a-importancia-de-cada-uma-delas');

