(33, '&lt;title&gt;Oferecemos Mão de Obra Qualificada, Treinada e Terceirizada para Empresas.&lt;/title&gt; \r\n \r\n&lt;meta name=&quot;description&quot; content=&quot;O Grupo Precisão tem como escopo a escolha de profissionais capacitados que atendam às necessidades específicas do contratante, oferecendo segurança, qualidade e consciência no cumprimento de seus deveres.&quot; /&gt; \r\n \r\n&lt;meta name=&quot;keywords&quot; content=“Terceirização de Limpeza, Empresa Terceirizada de Limpeza, Prestadora de Serviços de Limpeza, Serviços de Recepção, Terceirização de Recepção, Terceirização de Portaria, Terceirização de Serviços, Serviços Terceirizados.&quot; /&gt; \r\n\r\n&lt;meta name=&quot;rating&quot; content=&quot;General&quot; /&gt; \r\n\r\n&lt;meta name=&quot;expires&quot; content=&quot;0&quot; /&gt;\r\n\r\n&lt;meta name=&quot;language&quot; content=&quot;portuguese, PT-BR&quot; /&gt; \r\n\r\n&lt;meta name=&quot;distribution&quot; content=&quot;Global&quot; /&gt; \r\n\r\n&lt;meta name=&quot;revisit-after&quot; content=&quot;7 Days&quot; /&gt;\r\n\r\n&lt;meta name=&quot;author&quot; content=&quot;SD - http://www.system-dreams.com&quot; /&gt;\r\n\r\n&lt;meta name=&quot;publisher&quot; content=&quot;SD - http://www.system-dreams.com&quot; /&gt; \r\n\r\n&lt;meta name=&quot;copyright&quot; content=&quot;SystemDreams - Criação e Otimização de sites&quot; /&gt;', 'Home', '', '', 'home', '', 0, 1, 1, ''),
(34, '', 'Serviços', '<p><span style=\"font-size: 14px;\">Oferecemos soluções e adequadas ao complexo mercado de mão de obra qualificada</span><br></p>', '', 'servicos', '', 0, 0, 1, '5377138538_e0c052e070_b.jpg'),
(35, '', 'Artigos', '<p><span style=\"font-size: 14px;\">Acompanhe em nosso site e também em nossas redes sociais, novidades sobre nosso setor de Serviços Gerais</span><br></p>', '', 'artigos', '', 0, 0, 1, '5377138538_e0c052e070_b.jpg'),
(36, '', 'A Empresa', '<p></p><p style=\"font-weight: 400; line-height: 1rem; position: relative; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; font-size: 0.75rem; color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; letter-spacing: normal; orphans: 2; text-align: center; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial;\"></p><p></p><div class=\"section-header\" style=\"line-height: initial; position: relative; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; text-align: center; orphans: 2; text-indent: 0px; widows: 2; text-decoration-style: initial; text-decoration-color: initial;\"><h4 helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" font-weight:=\"\" 700;=\"\" line-height:=\"\" 1.1;=\"\" color:=\"\" rgb(51,=\"\" 51,=\"\" 51);=\"\" text-transform:=\"\" uppercase;\"=\"\" style=\"text-align: center;\">\r\n\r\n\r\n\r\n\r\n<style type=\"text/css\">\r\np.p1 {margin: 0.0px 0.0px 0.0px 0.0px; text-align: center; font: 12.0px \'Helvetica Neue\'; color: #454545}\r\n</style>\r\n\r\n\r\n<p class=\"p1\">\r\n\r\n\r\n\r\n\r\n<style type=\"text/css\">\r\np.p1 {margin: 0.0px 0.0px 0.0px 0.0px; text-align: center; font: 12.0px \'Helvetica Neue\'; color: #454545}\r\n</style>\r\n\r\n\r\n</p><p class=\"p1\" style=\"text-align: left; \"><font face=\"Helvetica\">Com sede em São Paulo e filial em Santa Catarina, o Grupo Precisão está no mercado, cuja meta principal é a satisfação de seus clientes e a qualidade nos serviços prestados.</font></p><p class=\"p1\" style=\"text-align: left;\"><span style=\"font-family: Helvetica;\"><br></span></p><p class=\"p1\" style=\"text-align: left;\"><span style=\"font-family: Helvetica;\">O Grupo Precisão tem como escopo a escolha de profissionais capacitados que atendam às necessidades específicas do contratante, oferecendo segurança, qualidade e consciência no cumprimento de seus deveres.</span><br></p><p class=\"p1\" style=\"text-align: left;\"><br></p><p class=\"p1\" style=\"text-align: left; \"><font face=\"Helvetica\">A política de qualidade da Precisão é obter e assegurar a qualidade de suas ações na prestação de serviços em geral e buscar a satisfação plena de seus clientes através de:</font></p><p class=\"p1\" style=\"text-align: left;\"><br></p><p class=\"p1\" style=\"text-align: left; \"><font face=\"Helvetica\">- Constantes investimentos na capacitação do pessoal, visando aperfeiçoamento em sua qualificação profissional;</font></p><p class=\"p1\" style=\"text-align: left;\"><span style=\"font-family: Helvetica;\">- Valorização dos nossos colaboradores, reconhecendo a competência, inteligência e criatividade de cada um;</span><br></p><p class=\"p1\" style=\"text-align: left;\"><span style=\"font-family: Helvetica;\">- Investimento em novos equipamentos que favoreçam a agilidade na prestação de serviço;</span><br></p><p class=\"p1\" style=\"text-align: left;\"><span style=\"font-family: Helvetica;\">- Constante identificação das necessidades do cliente e rápido atendimento ás solicitações;</span><br></p></h4><p style=\"color: rgb(0, 0, 0); font-family: MyriadPro; font-size: 0.875rem; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; letter-spacing: normal; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; font-weight: 400; line-height: initial; position: relative; box-sizing: inherit; margin: 5px auto 15px; padding: 0px; border: 0px; vertical-align: baseline; text-align: inherit !important;\"></p></div><style type=\"text/css\">\r\np.p1 {margin: 0.0px 0.0px 0.0px 0.0px; text-align: center; font: 12.0px \'Helvetica Neue\'; color: #454545}\r\n</style>', '<h4 helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" font-weight:=\"\" 700;=\"\" line-height:=\"\" 1.1;=\"\" color:=\"\" rgb(51,=\"\" 51,=\"\" 51);=\"\" text-transform:=\"\" uppercase;\"=\"\"><span style=\"color: rgb(156, 0, 0); font-weight: bold; font-family: Arial;\">GRUPO PRECISÃO</span></h4><h4 helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" font-weight:=\"\" 700;=\"\" line-height:=\"\" 1.1;=\"\" color:=\"\" rgb(51,=\"\" 51,=\"\" 51);=\"\" text-transform:=\"\" uppercase;\"=\"\"><span style=\"color: rgb(156, 0, 0); font-weight: bold; font-family: Arial;\"><br></span></h4><h4 helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" font-weight:=\"\" 700;=\"\" line-height:=\"\" 1.1;=\"\" color:=\"\" rgb(51,=\"\" 51,=\"\" 51);=\"\" text-transform:=\"\" uppercase;\"=\"\"><span style=\"color: rgb(156, 0, 0); font-weight: bold; font-family: Arial;\"> </span></h4><p><span style=\"font-family: Arial;\">Com sede em São Paulo e filial em Santa Catarina, o Grupo Precisão está no mercado, cuja meta principal é a satisfação de seus clientes e a qualidade nos serviços prestados. O Grupo Precisão tem como escopo a escolha de profissionais capacitados que atendam às necessidades específicas do contratante, oferecendo segurança, qualidade e consciência no cumprimento de seus deveres.</span></p><p><br></p><h4 helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" font-weight:=\"\" 700;=\"\" line-height:=\"\" 1.1;=\"\" color:=\"\" rgb(51,=\"\" 51,=\"\" 51);=\"\" text-transform:=\"\" uppercase;\"=\"\"><span style=\"font-family: Arial;\"> </span></h4><h4 helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" font-weight:=\"\" 700;=\"\" line-height:=\"\" 1.1;=\"\" color:=\"\" rgb(51,=\"\" 51,=\"\" 51);=\"\" text-transform:=\"\" uppercase;\"=\"\"><span style=\"font-weight: bold; color: rgb(156, 0, 0); font-family: Arial;\">VISÃO</span></h4><h4 helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" font-weight:=\"\" 700;=\"\" line-height:=\"\" 1.1;=\"\" color:=\"\" rgb(51,=\"\" 51,=\"\" 51);=\"\" text-transform:=\"\" uppercase;\"=\"\"><span style=\"font-weight: bold; color: rgb(156, 0, 0); font-family: Arial;\"><br></span></h4><h4 helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" font-weight:=\"\" 700;=\"\" line-height:=\"\" 1.1;=\"\" color:=\"\" rgb(51,=\"\" 51,=\"\" 51);=\"\" text-transform:=\"\" uppercase;\"=\"\"><span style=\"font-weight: bold; color: rgb(156, 0, 0); font-family: Arial;\"> </span></h4><p><span style=\"font-family: Arial;\">- Ser uma empresa eficiente, competitiva e inovadora.<br> </span><span style=\"font-family: Arial;\">- Temos como meta principal a valorização do relacionamento com nossos Clientes e Colaboradores.</span></p><h4 helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" font-weight:=\"\" 700;=\"\" line-height:=\"\" 1.1;=\"\" color:=\"\" rgb(51,=\"\" 51,=\"\" 51);=\"\" text-transform:=\"\" uppercase;\"=\"\"><br></h4><p><br></p><h4 helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" font-weight:=\"\" 700;=\"\" line-height:=\"\" 1.1;=\"\" color:=\"\" rgb(51,=\"\" 51,=\"\" 51);=\"\" text-transform:=\"\" uppercase;\"=\"\"><span style=\"font-family: Arial;\"> </span></h4><h4 helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" font-weight:=\"\" 700;=\"\" line-height:=\"\" 1.1;=\"\" color:=\"\" rgb(51,=\"\" 51,=\"\" 51);=\"\" text-transform:=\"\" uppercase;\"=\"\"><span style=\"font-weight: bold; color: rgb(156, 0, 0); font-family: Arial;\">VALORES </span></h4><p><span style=\"font-family: Arial;\"><br></span></p><p><span style=\"font-family: Arial;\">- Integridade, Responsabilidade, Perseverança, Transparência, Respeito e Direção.</span></p><p><br></p><h4 helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" font-weight:=\"\" 700;=\"\" line-height:=\"\" 1.1;=\"\" color:=\"\" rgb(51,=\"\" 51,=\"\" 51);=\"\" text-transform:=\"\" uppercase;\"=\"\"><span style=\"font-weight: bold; color: rgb(156, 0, 0); font-family: Arial;\"><br></span></h4><h4 helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" font-weight:=\"\" 700;=\"\" line-height:=\"\" 1.1;=\"\" color:=\"\" rgb(51,=\"\" 51,=\"\" 51);=\"\" text-transform:=\"\" uppercase;\"=\"\"><span style=\"font-weight: bold; color: rgb(156, 0, 0); font-family: Arial;\">MISSÃO </span></h4><p><span style=\"font-family: Arial;\"><br></span></p><p><span style=\"font-family: Arial;\">- Oferecer soluções inteligentes e adequadas ao complexo mercado de mão de obra qualificada; através de treinamento constante de pessoal e emprego de novas tecnologias no campo de materiais e equipamentos, buscando melhores índices de qualidade, produtividade e redução de custos. </span></p><h4 helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" font-weight:=\"\" 700;=\"\" line-height:=\"\" 1.1;=\"\" color:=\"\" rgb(51,=\"\" 51,=\"\" 51);=\"\" text-transform:=\"\" uppercase;\"=\"\"><br></h4><h4 helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" font-weight:=\"\" 700;=\"\" line-height:=\"\" 1.1;=\"\" color:=\"\" rgb(51,=\"\" 51,=\"\" 51);=\"\" text-transform:=\"\" uppercase;\"=\"\"><span style=\"color: rgb(156, 0, 0); font-weight: bold; font-family: Arial;\"><br></span></h4><h4 helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" font-weight:=\"\" 700;=\"\" line-height:=\"\" 1.1;=\"\" color:=\"\" rgb(51,=\"\" 51,=\"\" 51);=\"\" text-transform:=\"\" uppercase;\"=\"\"><span style=\"color: rgb(156, 0, 0); font-weight: bold; font-family: Arial;\">POLÍTICA DE QUALIDADE </span></h4><p><span style=\"font-family: Arial;\"><br></span></p><p><span style=\"font-family: Arial;\">A política de qualidade da Precisão é obter e assegurar a qualidade de suas ações na prestação de serviços em geral e buscar a satisfação plena de seus clientes através de: </span></p><p><span style=\"font-family: Arial;\">- Constantes investimentos na capacitação do pessoal, visando aperfeiçoamento em sua qualificação profissional; </span></p><p><span style=\"font-family: Arial;\">- Valorização dos nossos colaboradores, reconhecendo a competência, inteligência e criatividade de cada um; </span></p><p><span style=\"font-family: Arial;\">- Investimento em novos equipamentos que favoreçam a agilidade na prestação de serviço; </span></p><p><span style=\"font-family: Arial;\">- Constante identificação das necessidades do cliente e rápido atendimento ás solicitações;</span></p>', 'a-empresa', '', 0, 0, 1, '5377138538_e0c052e070_b.jpg'),
(37, '', 'Terceirize', '', '<h1 style=\"box-sizing: border-box; font-family: Montserrat, \">\r\n\r\n\r\n\r\n\r\n<style type=\"text/css\">\r\np.p1 {margin: 0.0px 0.0px 0.0px 0.0px; font: 12.0px \'Helvetica Neue\'; color: #454545; min-height: 14.0px}\r\np.p2 {margin: 0.0px 0.0px 0.0px 0.0px; font: 17.0px \'Helvetica Neue\'; color: #454545}\r\np.p3 {margin: 0.0px 0.0px 0.0px 0.0px; font: 12.0px \'Helvetica Neue\'; color: #454545}\r\np.p4 {margin: 0.0px 0.0px 2.0px 0.0px; font: 14.0px \'Helvetica Neue\'; color: #454545}\r\n</style>\r\n\r\n\r\n<p class=\"p1\"><span style=\"color: rgb(156, 0, 0);\"><b style=\"font-size: 17px;\">Vantagens da terceirização</b><br></span></p>\r\n<p class=\"p3\"><span style=\"color: rgb(156, 0, 0);\"><br>\r\n</span></p>\r\n<p class=\"p4\"><b style=\"color: rgb(156, 0, 0);\">ESPECIALIZAÇÃO, AGILIDADE E FLEXIBILIZAÇÃO</b></p>\r\n<p class=\"p3\"><br>\r\n</p>\r\n<p class=\"p3\">Terceirizando seus serviços através do Grupo Precisão, você terá a certeza de poder contratar uma empresa especializada e voltada exclusivamente para administração de recursos humanos, com pessoal treinado nas funções específicas.</p>\r\n<p class=\"p3\"><br>\r\nElimine os transtornos de substituição de pessoal por faltas, férias, folgas, licença médica, sobrando mais tempo para o contratante dedicar-se à sua atividade fim.<br>\r\n</p>\r\n<p class=\"p3\"><br>\r\nO foco principal do Grupo Precisão é a satisfação de seus clientes. Somente uma empresa especializada e ágil tem capacidade para atender seus serviços com flexibilidade, isto é, suprir a necessidade de pessoal de acordo com as necessidades do cliente.</p>\r\n<p class=\"p3\"><br>\r\n</p>\r\n<p class=\"p3\">PRINCIPAIS VANTAGENS - Supervisão 24 horas.</p>\r\n<p class=\"p3\">- Nivelamento e melhoria da qualidade dos serviços.</p>\r\n<p class=\"p3\">- Diminuição de problemas administrativos.</p>\r\n<p class=\"p3\">- Coberturas de férias, faltas, licenças médicas ou qualquer imprevisto que ocorra.</p>\r\n<p class=\"p3\">- Flexibilidade na rescisão contratual, que pode ser imediata no caso de insatisfação do Contratante.</p>\r\n<p class=\"p3\">- Substituição do funcionário que não estiver correspondendo às expectativas ou as demandas do serviço.</p>\r\n<p class=\"p3\">- Redução de custos com encargos trabalhistas;</p>\r\n<p class=\"p3\">- Eliminação de gastos com recrutamento, seleção e treinamento de pessoal;</p>\r\n<p class=\"p3\">- Ausência de vínculo empregatício com o trabalhador;</p>\r\n<p class=\"p3\">- Controle rigoroso do recolhimento de encargos sociais e fiscais;</p>\r\n<p class=\"p3\">- Eliminação de ociosidade e aumento de produtividade;</p>\r\n<p class=\"p3\">- Foco na atividade fim;</p>\r\n<p class=\"p3\">- Redução de investimentos em serviço de apoio.</p>\r\n<p class=\"p3\"><br>\r\n</p>\r\n<p class=\"p3\"><span style=\"color: rgb(156, 0, 0);\">BENEFÍCIOS PARA O CLIENTE</span></p>\r\n<p class=\"p3\">- Mão-de-obra especializada.</p>\r\n<p class=\"p3\">- Despreocupação com supervisão do colaborador.</p>\r\n<p class=\"p3\">- Custo/benefício positivo.</p>\r\n<p class=\"p3\">- Ganho</p></h1>', 'terceirize', '', 0, 0, 1, '5377138538_e0c052e070_b.jpg');
INSERT INTO `paginas` (`id`, `headers`, `titulo`, `resumo`, `conteudo`, `slug`, `pagina_mae`, `subpagina`, `anchor`, `showmenu`, `image`) VALUES
(38, '', 'Meio Ambiente', '', '<p>Hoje a importância da preservação do meio ambiente é necessidade de consciência de todos pelo bem-estar, qualidade de vida de cada indivíduo e pela sobrevivência do homem como espécie. Contribuímos disseminando consciência ambiental para os nossos colaboradores, racionalizando água, energia, produtos de limpeza, fazendo a manutenção correta das nossas máquinas, equipamentos e reciclando todos os materiais possíveis que usam Tendo em mente a contribuição para a melhoria do ambiente em que vivemos.&nbsp;<br><br>Abaixo em PDF estão às tabelas FISPQ’s dos produtos de limpeza que utilizamos nos nossos serviços.&nbsp;<br><br><span style=\"color: rgb(156, 0, 0);\"><strong>FISPQ - Cloro&nbsp;</strong><br><br><strong>FISPQ - Desinfetante&nbsp;</strong><br><br><strong>FISPQ - Detergentes Neutros&nbsp;</strong><br><br><strong>FISPQ - Limpa carpete&nbsp;</strong><br><br><strong>FISPQ - Limpa pedras&nbsp;</strong><br><br><strong>FISPQ - Multi uso tradicional&nbsp;</strong></span><br>&nbsp;</p><p><br>A Fundação Abrinq é uma organização social que, desde 1990, trabalha para que os direitos de crianças e adolescentes sejam respeitados. O estágio que a organização alcançou permitiu que a partir de 2010, firmasse parceria com a maior e mais antiga ONG de defesa de direitos da criança no mundo, a Save the Children Internacional.</p><p>&nbsp;</p><p>Os projetos que ambas desenvolvem na área da educação, saúde e proteção em todo o Brasil continuam a ser operados, porém a rede de programas de abrangência nacional foi ampliada, o que vem dar voz às questões que envolvem o cenário da infância brasileira para o mundo e fará com que o número de crianças e adolescentes atendidos salte dos atuais 260 mil, para aproximadamente um milhão por ano, nos próximos anos. Também a partir da parceria, baseada em metodologias internacionais, a organização passou a atuar na área de Emergência, e implantou atividades que vão desde o socorro imediato até ações de redução de risco de desastre.</p><p>&nbsp;</p><p>Pautada pela Convenção Internacional dos Direitos da Criança (ONU, 1989), Constituição Federal Brasileira (1988) e Estatuto governamentais para prestação de serviços ou defesa de direitos, estímulo à responsabilidade social, articulação política e social na construção e defesa dos direitos e conhecimento da realidade brasileira quanto aos direitos da criança e do adolescente.</p><p>&nbsp;</p><p><span style=\"color: rgb(156, 0, 0); font-weight: bold;\">Para mais informações acesse: www.fundabrinq.org.br</span></p><p>&nbsp;<img src=\"data:image/jpeg;base64,\" data-filename=\"bg1.jpg\" style=\"width: 25%;\"></p>', 'meio-ambiente', '', 0, 0, 1, '5377138538_e0c052e070_b.jpg');
