INSERT INTO `servicos` (`id`, `titulo`, `url`, `text`, `headers`, `slug`) VALUES
(23, 'Jardinagem', 'jardinagem.jpg', '\r\n\r\n\r\n\r\n&lt;style type=&quot;text/css&quot;&gt;\r\np.p1 {margin: 0.0px 0.0px 0.0px 0.0px; font: 12.0px \'Helvetica Neue\'; color: #454545}\r\n&lt;/style&gt;\r\n\r\n\r\n&lt;p class=&quot;p1&quot;&gt;Preservar as áreas verdes de sua empresa, ou do condomínio que reside, é uma maneira prática e fácil de passar uma boa imagem aos visitantes, clientes ou moradores.&lt;/p&gt;', '', 'jardinagem'),
(22, 'Manutenção Predial', 'manutencao.jpg', '\r\n\r\n\r\n\r\n\r\n&lt;style type=&quot;text/css&quot;&gt;\r\np.p1 {margin: 0.0px 0.0px 0.0px 0.0px; font: 12.0px \'Helvetica Neue\'; color: #454545}\r\n&lt;/style&gt;\r\n\r\n\r\n&lt;p class=&quot;p1&quot;&gt;A importância da manutenção predial é a minimização dos gastos, reduzindo gastos enormes com reformas e correções, não devendo ser feita de modo improvisado e casual, mas sim como um serviço técnico cuja responsabilidade exige capacitação apurada e isso é o que os colaboradores da Precisão possuem para oferecer o melhor serviço possível.&lt;/p&gt;', '', 'manutencao-predial'),
(18, 'Portaria', 'portaria.jpg', '\r\n\r\n\r\n\r\n\r\n&lt;style type=&quot;text/css&quot;&gt;\r\np.p1 {margin: 0.0px 0.0px 0.0px 0.0px; font: 12.0px \'Helvetica Neue\'; color: #454545}\r\n&lt;/style&gt;\r\n\r\n\r\n&lt;p class=&quot;p1&quot;&gt;Atenção e presteza são as marcas de nossos porteiros.Os porteiros zelam pela guarda do patrimônio, percorrendo-os sistematicamente, inspecionando suas dependências para evitar incêndios, roubos, entrada de pessoas estranhas e outras anormalidades. Também controla fluxo de pessoas, identificando, orientando e encaminhando-as para os lugares desejados.&lt;/p&gt;', '', 'portaria'),
(21, 'Copa', 'copa.jpg', '&lt;p&gt;\r\n\r\n\r\n\r\n\r\n&lt;style type=&quot;text/css&quot;&gt;\r\np.p1 {margin: 0.0px 0.0px 0.0px 0.0px; font: 12.0px \'Helvetica Neue\'; color: #454545}\r\n&lt;/style&gt;\r\n\r\n\r\n&lt;/p&gt;&lt;p class=&quot;p1&quot;&gt;O serviço de copeira é insubstituível em locais que recebam clientes, visitantes e convidados, para palestras, reuniões, discursos, entre outras atividades que acontecem em seu estabelecimento. Os profissionais de Copa são capacitados, experientes e possuem um ótimo treinamento para que exista total higiene, controle e organização dos serviços.&lt;/p&gt;', '', 'copa'),
(19, 'Recepção', 'recepcionista.jpg', '&lt;p&gt;\r\n\r\n\r\n\r\n\r\n&lt;style type=&quot;text/css&quot;&gt;\r\np.p1 {margin: 0.0px 0.0px 0.0px 0.0px; font: 12.0px \'Helvetica Neue\'; color: #454545}\r\n&lt;/style&gt;\r\n\r\n\r\n&lt;/p&gt;&lt;p class=&quot;p1&quot;&gt;Receber e atender com eficiência, reflete a preocupação de uma empresa em valorizar seu cliente. Nossas recepcionistas agregam simpatia e competência em tudo o que fazem.&lt;/p&gt;', '', 'recepcao'),
(20, 'Limpeza e Conservação', 'limpeza.jpg', '&lt;p&gt;\r\n\r\n\r\n\r\n\r\n&lt;style type=&quot;text/css&quot;&gt;\r\np.p1 {margin: 0.0px 0.0px 0.0px 0.0px; font: 12.0px \'Helvetica Neue\'; color: #454545}\r\n&lt;/style&gt;\r\n\r\n\r\n&lt;/p&gt;&lt;p class=&quot;p1&quot;&gt;O Grupo Precisão é a parceria que valoriza a imagem de sua empresa/condomínio, através da limpeza e conservação. Nossos colaboradores são altamente qualificados e antes de serem selecionados para o cargo passam por um processo de treinamento eficaz onde são ensinadas técnicas específicas de limpeza, a fim de ter total certeza de que será feito um trabalho de ótima qualidade.&lt;/p&gt;', '', 'limpeza-e-conservacao'),
(24, 'Zeladoria', 'zelador.jpg', '&lt;p&gt;\r\n\r\n\r\n\r\n\r\n&lt;style type=&quot;text/css&quot;&gt;\r\np.p1 {margin: 0.0px 0.0px 0.0px 0.0px; font: 12.0px \'Helvetica Neue\'; color: #454545}\r\n&lt;/style&gt;\r\n\r\n\r\n&lt;/p&gt;&lt;p class=&quot;p1&quot;&gt;O Zelador deve fiscalizar as áreas comuns do condomínio, verificar se os trabalhos estão sendo feitos de forma correta, supervisionar o funcionamento das instalações elétricas e se necessário fazer reparos na mesma, tendo sempre uma manutenção preventiva e diminuindo as chances de ter um custo maior no futuro por falta de manutenção. Além disso, o Zelador é o contato direto com o Síndico.&lt;/p&gt;', '', 'zeladoria');

